  display: flex;
  flex-direction: row;
  width: 100%;
  height: 64px;
  border-bottom: 2px solid #f7f7f7;
`;

const Header = styled.div`

`;

export const NavBar = () => {
  return (
    <NavBarStyled>
      <div>
        <EquinorIcon icon={Icon.MENU}/>
        <span>Neqsim</span>
      </div>
      <div>
        <EquinorIcon icon={Icon.USER}/>
      </div>
    </NavBarStyled>
  );
};
